


# Table: region
#------------------------------------------------------------
CREATE TABLE IF NOT EXISTS region (
id_region Int Auto_increment NOT NULL ,
nom_region Varchar (255) NOT NULL
,CONSTRAINT region_PK PRIMARY KEY (id_region)
)ENGINE=InnoDB;


CREATE TABLE IF NOT EXISTS departement (
id_departement Varchar (3) NOT NULL ,
nom_departement Varchar (100) NOT NULL ,
id_region Int NOT NULL
,CONSTRAINT departement_PK PRIMARY KEY (id_departement)
,CONSTRAINT departement_region_FK FOREIGN KEY (id_region) REFERENCES region(id_region)
)ENGINE=InnoDB;


CREATE TABLE IF NOT EXISTS ville (
id_ville Int Auto_increment NOT NULL ,
nom_ville Varchar (100) NOT NULL ,
code_postal Varchar (6) NOT NULL ,
code_insee Varchar (6) NOT NULL ,
id_departement Varchar (3) NOT NULL
,CONSTRAINT ville_PK PRIMARY KEY (id_ville)
,CONSTRAINT ville_departement_FK FOREIGN KEY (id_departement) REFERENCES departement(id_departement)
)ENGINE=InnoDB;








